    <script>
        $(document).ready(function(){
            $("#js-ripple-btn2").on('click', function(){
                var filter = /^([\w-\.]+)@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.)|(([\w-]+\.)+))([a-zA-Z]{2,4}|[0-9]{1,3})(\]?)$/;
                var name = $("#name").val();
                var email = $("#email").val();
                var mobile = $("#mno").val();
                var pno = $("#pno").val();
                var org = $("#org").val();
                var city = $("#city").val();
                
                if(name == ""){
                    $("#name").css("border-color","red");
                    $("#nameerror").text("Name cannot be empty");
                    return false;
                }else
                if(email == ""){
                    $("#email").css("border-color","red");
                    return false;
                }else
                if(!filter.test(email)){
                    $("#email").css("border-color","red");
                    return false;
                }else
                if(mobile == ""){
                    $("#mno").css("border-color","red");
                    return false;
                }else
                if(mobile.length != 10){
                    $("#mno").css("border-color","red");
                    return false;
                }else
                if(pno == ""){
                    $("#pno").css("border-color","red");
                    return false;
                }else 
                if(org == ""){
                    $("#org").css("border-color","red");
                    return false;
                }else
                if(city == ""){
                    $("#city").css("border-color","red");
                    return false;
                }else
                if($("#case").val() == -1){
                    $("#case").css("border-color","red");
                    return false;
                }

            });
        });      

    </script>
